using System;
using System.Collections.Generic;
using System.Linq;
using System.Web;
using System.Web.UI;
using System.Web.UI.WebControls;

namespace WebAppExample._03_Control
{
    public partial class OtherButton : System.Web.UI.Page
    {
        protected void Page_Load(object sender, EventArgs e)
        {
            ImgBtn_DotNet.ImageUrl = "data:image/jpeg;base64,";
        }

        protected void lbtn_DotNet_Click(object sender, EventArgs e)
        {
            Response.Redirect("https://www.youtube.com");
        }

        protected void ImgBtn_DotNet_Click(object sender, ImageClickEventArgs e)
        {
            Response.Write($"{e.X}, {e.Y}");
        }
    }
}